Edit this Rust code to improve the runtime complexity of the program.def solve(list):
    max_len = 0
    for i in range(len(list)-1):
        for j in range(i+1, len(list)):
            if list[i] == list[j]:
                cur_len = 0
                k = 0
                while i+k < len(list) and j+k < len(list) and list[i+k] == list[j+k]:
                    cur_len += 1
                    k += 1
                max_len = max(max_len, cur_len)
    return max_len

