Write an algorithm to optimize an implementation of an algorithm given in Rust.# naive implementation code

def insertionSort(arr): 
    n = len(arr)
    for i in range(1, n): 
        key = arr[i]
        j = i-1
        while j >=0 and key < arr[j] : 
            arr[j+1] = arr[j] 
            j -= 1
        arr[j+1] = key

