Write Rust code to edit a given function and optimize it so that it will run faster.def find_largest_value(arr):
    largest_value = -float('inf')
    for i in range(len(arr)):
        for j in range(i+1, len(arr)):
            if arr[i] + arr[j] > largest_value:
                largest_value = arr[i] + arr[j]
    return largest_value
